import React from 'react';
import { StyledTitle } from './styles';

export interface ITitleProps {
  children: React.ReactChild | React.ReactChildren;
  size: 'XS' | 'S' | 'M' | 'L';
  as: any;
  className?: string;
};

const Title: React.FC<ITitleProps> = ({ className, children, as, size }) => {
  return (
    <StyledTitle as={as} size={size} className={className}>
      {children}
    </StyledTitle>
  )
};

export default Title;
